import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const FAQSection = () => {
  const [openFAQ, setOpenFAQ] = useState(null);

  const faqs = [
    {
      id: 1,
      question: "What services does Skygate Group provide?",
      answer: "Skygate Group provides comprehensive logistics and travel solutions through two specialized divisions. Skygate Logistics offers freight forwarding from the United States and China, warehousing & distribution, supply chain management, and last-mile delivery. Skygate Travel provides corporate travel management, leisure travel planning, group travel coordination, and 24/7 travel support.",
      category: "general",
